                <h2 style=""text-align:center""><b>Welcome To C# course</b></h2>
                <hr />
                <div>
                    <h1 class=""text-primary"">C# Data Types</h1>
                </div>
                <div>A data type specifies the size and type of variable values. It is important to use the correct data type for the corresponding variable; to avoid errors, to save time and memory, but it will also make your code more maintainable and readable. The most common data types are:</div><br>
                <table class=""table table-bordered table-striped"">
                    <tr>
