                <br>
                <h1 class=""font-weight-bold"">Integer Types</h1><br>
                <h2 class=""font-weight-bold"">Int</h2>
                <p>
                    The int data type can store whole numbers from -2147483648 to 2147483647. In general, and in our tutorial, the int data type is the preferred data type when we create variables with a numeric value.
                </p><br>
                <h2 class=""font-weight-bold"">Long</h2>
                <p>
                    The long data type can store whole numbers from -9223372036854775808 to 9223372036854775807. This is used when i");
